Templates.template:
fireFileNotSupported(
	{
		fileNames: ${fileNames} // any
	}
)

fireChange(
	{
		newValue: "${newValue}" // string
	}
)

getInstance(
	{
		style: "${style}" // string
	},
	"${oLocale}" // sap.ui.core.Locale
)

getDateInstance(
	{
		pattern: "${pattern}", // string
		style: "${style}" // string
	},
	"${oLocale}" // sap.ui.core.Locale
)

getDateTimeInstance(
	{
		pattern: "${pattern}", // string
		style: "${style}" // string
	},
	"${oLocale}" // sap.ui.core.Locale
)

getTimeInstance(
	{
		pattern: "${pattern}", // string
		style: "${style}" // string
	},
	"${oLocale}" // sap.ui.core.Locale
)

getInstance(
	{
		shortDecimals: ${iShortDecimals} // number
	},
	"${oLocale}" // sap.ui.core.Locale
)

getInstance(
	{
		style: "${style}" // string
	},
	"${oLocale}" // sap.ui.core.Locale
)

new sap.ca.ui.model.type.Date(
	{
		source: ${source} // object
	},
	{
		minimum: ${minimum}, // Date|string
		maximum: ${maximum} // Date|string
	}
)
